    return(
      <>
      <Navheaderad />
      <Outlet />
      <Footer />
      </>
    );
  }
const ProtectedRoutesS = () => {
    const isAuth = localStorage.getItem("token") && localStorage.getItem('role')==="STAFF";
    return isAuth ? <Outlet /> : <Navigate to="/" />;
  };

export default ProtectedRoutesS;
